        Cookie: "cookie1=value; cookie2=value; cookie3=value;",
        Authorization: "Bearer my-token",
      },
      withCredentials: true,
    })
    .then(res=>{
      console.log(res)
      Setuser(res.data)
    })
    .catch(err=>{
      console.log(err)
    })
  })*/
  /*function click(){
navigation.navigate('PetProfile')
  }*/
